import React, { Component } from "react";

class LifeCycleCompo extends Component {
  render() {
    const tit = this.props.tit;

    return (
      <div className="LifeCycleCompo">
        <h4>LifeCycleCompo</h4>
        <p>{tit}</p>
      </div>
    );
  }
}

export default LifeCycleCompo;
